import React from 'react';

import './Layout.css';
import Aux from '../Auxillary/Auxillary';

const Layout = (props) => {
  return (
    <Aux>
      1. tool bar
      <main>{props.children}</main>
      2. footer
    </Aux>
  );
};

export default Layout;
